function calculateDominicanPayroll(e){if("number"!=typeof e)return null;const t={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},r={threshold:72260.25,rate:.25,fixedAmount:6648},l=.0304*e,h=.0287*e,n=e-(l+h);let s=0;if(n>=r.threshold){const e=n-r.threshold;s=r.fixedAmount+e*r.rate}else if(n<r.threshold&&n>=o.threshold){const e=n-o.threshold;s=o.fixedAmount+e*o.rate}else if(n<o.threshold&&n>=t.threshold){const e=n-t.threshold;s=t.fixedAmount+e*t.rate}else s=0;return{monthlySalary:e,netMonthlySalary:n-s,sfs:l,afp:h,isr:s,deductions:l+h+s}}